import  React, {useState} from 'react';
import { styled } from '@mui/material/styles';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import MenuItem from '@mui/material/MenuItem';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import ExitToAppIcon from '@mui/icons-material/ExitToApp';
import PeopleIcon from '@mui/icons-material/People';
import Collapse from '@mui/material/Collapse';
import BusinessIcon from '@mui/icons-material/Business';
import Box from '@mui/material/Box';
import Badge from '@mui/material/Badge';
import MailIcon from '@mui/icons-material/Mail';
import NotificationsIcon from '@mui/icons-material/Notifications';
import MoreIcon from '@mui/icons-material/MoreVert';
import SideDrawerMenu from './Sidemenu';
import Avatar from '@mui/material/Avatar';
import Stack from '@mui/material/Stack';
import DashboardTable from './Table';
import InventoryIcon from '@mui/icons-material/Inventory';
import BuildIcon from '@mui/icons-material/Build';
import MonetizationOnSharpIcon from '@mui/icons-material/MonetizationOnSharp';
import ReceiptSharpIcon from '@mui/icons-material/ReceiptSharp';
import InventorySharpIcon from '@mui/icons-material/InventorySharp';
import KeyboardReturnSharpIcon from '@mui/icons-material/KeyboardReturnSharp';
import ShoppingCartSharpIcon from '@mui/icons-material/ShoppingCartSharp';
import ListItemButton from '@mui/material/ListItemButton';

import InboxIcon from '@mui/icons-material/Inbox';
import HomeIcon from '@mui/icons-material/Home';
import ExpandLess from "@mui/icons-material/ExpandLess";
import ExpandMore from "@mui/icons-material/ExpandMore";


const useStyles = styled((theme) => ({
    root: { flexGrow: 1 },
    menuButton: { marginRight: theme.spacing(2) },
    title: { flexGrow: 1 },
    list: { width: 250 },
    nested: { paddingLeft: theme.spacing(4) }
  }));

  const Dashboard = () => {
    const [drawerOpen, setDrawerOpen] = useState(false);
    const [anchorEl, setAnchorEl] = useState(null);

    const [leadershipTriadMenuOpen, setLeadershipTriadMenuOpen] = useState(false);

    const handleLeadershipTriadClick = () => {
      setLeadershipTriadMenuOpen(!leadershipTriadMenuOpen);
    };

    const handleClick = (event) => {
      setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
      setAnchorEl(null);
    };

    const toggleDrawer = () => {
      setDrawerOpen(!drawerOpen);
    };

    const list = (anchor) => (
        <Box
            sx={{ width: anchor === 'top' || anchor === 'bottom' ? 'auto' : 250 }}
            role="presentation"
            onClick={toggleDrawer(anchor, false)}
            onKeyDown={toggleDrawer(anchor, false)}
        >
            <List>
                {['Stocks', 'Raw Material', 'Bills', 'Inventory'].map((text, index) => (
                    <ListItem key={text} disablePadding>
                        <ListItemButton>
                            <ListItemIcon>
                                {index === 0 ? <InventoryIcon/> : ''}
                                {index === 1 ?  <BuildIcon />: ''}
                                {index === 2 ?  <ReceiptSharpIcon />: ''}
                                {index === 3 ?  <InventorySharpIcon />: ''}
                            </ListItemIcon>
                            <ListItemText primary={text} />
                        </ListItemButton>
                    </ListItem>
                ))}
            </List>
            <Divider />
            <List>
                {['SalesList', 'PurchaseList', 'Return'].map((text, index) => (
                    <ListItem key={text} disablePadding>
                        <ListItemButton>
                            <ListItemIcon>
                                {index === 0 ? <MonetizationOnSharpIcon /> : ''}
                                {index === 1 ? <ShoppingCartSharpIcon /> : ''}
                                {index === 2 ? <KeyboardReturnSharpIcon /> : ''}

                            </ListItemIcon>
                            <ListItemText primary={text} />
                        </ListItemButton>
                    </ListItem>
                ))}
            </List>
        </Box>
    );

    const classes = useStyles();
    return (
      <div className={classes.root}>
        <AppBar position="static">
          <Toolbar>
            <IconButton
              edge="start"
              className={classes.menuButton}
              color="inherit"
              aria-label="menu"
              onClick={() => toggleDrawer()}
            >
              <MenuIcon />
              <Drawer
                anchor="left"
                open={drawerOpen}
                onClose={() => toggleDrawer()}
              >
                <div className={classes.list}>
                {list(anchor)}
                </div>
              </Drawer>
            </IconButton>
            <Typography variant="h6" className={classes.title}>
              Admin Panel
            </Typography>
            <IconButton color="inherit" onClick={handleClick}>
              <AccountCircleIcon />
            </IconButton>
            <Menu
              id="admin-menu"
              anchorEl={anchorEl}
              keepMounted
              open={Boolean(anchorEl)}
              onClose={handleClose}
            >
              <MenuItem onClick={handleClose}>Profile</MenuItem>
              <MenuItem onClick={handleClose}>Logout</MenuItem>
            </Menu>
          </Toolbar>
        </AppBar>
        <DashboardTable /> 
      </div>
    );
  };

export default Dashboard;
